        return (
            <>
                   <MyContext.Consumer>
                                      {
                                       ({data,handleClick})=>(
                                           <div>
                                                            {/* <h4>Name: {data.name}  value: {data.value}</h4> */}
                                                             <button onClick={handleClick}>change</button>
                                           </div>
                                             
                                        )}
                          
                   </MyContext.Consumer>
                   <h1>Guest component</h1>
            </>
        )
    }
}
